(1, 1, '1', '<code>img</code> element with an <code>alt</code> attribute.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r<title>Testfile - Check #1 - Negative</title>\r</head>\r<body>\r<p><img src="rex.jpg" alt="A black and brown cat named Rex."/></p>\r</body>\r</html>'),
(2, 1, '0', '<code>img</code> element without an <code>alt</code> attribute.', '<?xml version="1.0" encoding="UTF-8"?>\n<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\n<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\n<head>\n<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\n<title>Testfile - Check #1 - Positive</title>\n</head>\n<body>\n<p><img src="rex.jpg"/></p>\n</body>\n</html>'),
(3, 2, '1', 'Alt text is different from <code>src</code> attribute.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #2 - Negative</title>\r</head>\r<body>\r<img src="rex.jpg" alt="photo of rex the cat"/>\r</body>\r</html>'),
(4, 2, '0', 'Alt text is the same as <code>src</code> attribute.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #2 - Positive</title>\r</head>\r<body>\r<img src="rex.jpg" alt="rex.jpg"/>\r</body>\r</html>'),
(5, 3, '1', 'Alt text is shorter than 100 characters.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r<title>OAC Testfile - Check #3 - Negative</title>\r</head>\r<body>\r<p><img src="rex.jpg" alt="photo of rex the cat"/></p>\r</body>\r</html>'),
(6, 3, '0', 'Alt text is longer than 100 characters.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r<title>OAC Testfile - Check #3 - Positive</title>\r</head>\r<body>\r<p><img src="rex.jpg" alt="A picture of Rex the cat with some extra text. This is very long alt text. In fact, it was much much too long for this image. Sort alt text would be much better and this alt text should be shortened."/></p>\r</body>\r</html>'),
(7, 4, '1', 'IMG is non-decorative and has valid Alt text.', '<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/REC-html40/strict.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #4 - Negative</title>\r</head>\r<body>\r<p>We would like to adopt another pet and are looking for one that is similar to what''s shown in the picture.</p>\r<img src="rex.jpg" alt="large brown and black cat named Rex" width="150" height="105"/>\r</body>\r</html>'),
(8, 4, '0', 'IMG is non-decorative but has empty Alt text.', '<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/REC-html40/strict.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #4 - Positive</title>\r</head>\r<body>\r<p>We would like to adopt another pet and are looking for one that is similar to what''s shown in the picture.</p>\r<img src="rex.jpg" alt="" width="150" height="105"/>\r</body>\r</html>'),
(9, 5, '1', '<code>img</code> element has whitespace Alt text but width and height are less than 25.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #5 - Negative</title>\r</head>\r<body>\r<img src="spacer.gif" alt="  " width="5" height="5"/>\r</body>\r</html>'),
(10, 5, '0', '<code>img</code> element has whitespace Alt text and width and height are both greater than 25.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #5 - Positive</title>\r</head>\r<body>\r<img src="rex.jpg" alt="  " width="150" height="105"/>\r</body>\r</html>'),
(11, 6, '1', '<code>img</code> has alt text that does not contain any placeholder text.', '<?xml version="1.0" encoding="UTF-8"?>\n<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\n<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\n<head>\n<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\n<title>OAC Testfile - Check #6 - Negative</title>\n</head>\n<body>\n<p><img src="rex.jpg" alt="Photo of a brown and black cat named Rex."/></p>\n</body>\n</html>'),
(12, 6, '0', '<code>img</code> has alt text of ''spacer''.', '<?xml version="1.0" encoding="UTF-8"?>\n<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\n<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\n<head>\n<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\n<title>OAC Testfile - Check #6 - Positive</title>\n</head>\n<body>\n<p><img src="rex.jpg" alt="spacer" width="150" height="105"/></p>\n</body>\n</html>'),
(13, 7, '1', '<code>img</code> is contained by A element, anchor has no other text and Alt text is not empty.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<title>OAC Testfile - Check #7 - Negative</title>\r</head>\r<body>\r<p><a href="rex.html"><img src="rex.jpg" alt="a story about Rex the cat"/></a></p>\r</body>\r</html>'),
(14, 7, '0', '<code>img</code> is contained by A element, anchor has no other text and Alt text is empty.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<title>OAC Testfile - Check #7 - Positive</title>\r</head>\r<body>\r<p><a href="rex.html"><img src="rex.jpg" alt=""/></a></p>\r</body>\r</html>'),
(15, 8, '1', 'Image is not fully described in Alt text but image has a <code>longdesc</code> attribute.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<title>OAC Testfile - Check #8.2 - Negative</title>\r</head>\r<body>\r<p>The text in this document does not fully describe the image shown here but the image contains a longdesc attribute linking to a text file that does describe the image. <img src="chart.gif" alt="a complex chart" longdesc="chart.html"/></p>\r</body>\r</html>'),
(16, 8, '0', 'Image is not fully described in Alt text and a long description is not provided.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<title>OAC Testfile - Check #8.1 - Positive</title>\r</head>\r<body>\r<p>The text in this document does not fully describe the complex image shown here.\r<img src="chart.gif" alt="a complex chart" /></p>\r</body>\r</html>'),
(17, 9, '1', '<code>img</code> with a <code>longdesc</code> and d-link.', '<?xml version="1.0" encoding="UTF-8"?>\r\n<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r\n<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r\n<head>\r\n<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r\n<title>OAC Testfile - Check #9 - Positive</title>\r\n</head>\r\n<body>\r\n<p><img src="rex.jpg" alt="photo of Rex the cat" width="300" height="300" longdesc="rex.html" />\r\n<a href="rex.html">[d]</a></p>\r\n</body>\r\n</html>'),
(18, 9, '0', '<code>img</code> with <code>longdesc</code> but no d-link.', '<?xml version="1.0" encoding="UTF-8"?>\r\n<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r\n<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r\n<head>\r\n<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r\n<title>OAC Testfile - Check #9 - Positive</title>\r\n</head>\r\n<body>\r\n<p><img src="rex.jpg" alt="photo of Rex the cat" width="300" height="300" longdesc="rex.html" /></p>\r\n</body>\r\n</html>'),
(19, 10, '1', 'Image does not flicker.', '<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/REC-html40/strict.dtd">\r<html lang="en">\r<head>\r<title>ATRC Testfile - Check #10.2 - Negative</title>\r</head>\r<body>\r<img src="rex.gif" alt="A brown and black cat named Rex."/>\r</body>\r</html>'),
(20, 10, '0', 'Image flickers.', '<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/REC-html40/strict.dtd">\r<html lang="en">\r<head>\r<title>ATRC Testfile - Check #10.1 - Positive</title>\r</head>\r<body>\r<img src="eatatjoes.gif" alt="eat at Joes" width="200" height="200"/>\r</body>\r</html>'),
(21, 11, '1', 'Alt text has all text within image.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r<title>OAC Testfile - Check #11 - Negative</title>\r</head>\r<body>\r<p><img src="http://www.freeiconsweb.com/Bookmark/su.png" alt="W3C Working Draft logo"/></p>\r</body>\r</html>'),
(22, 11, '0', 'Alt text does not contain all text in image.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r<title>OAC Testfile - Check #11 - Positive</title>\r</head>\r<body>\r<p><img src="http://www.w3.org/2005/11/MWI-Icons/MWI-Picto.png" alt="logo" /></p>\r</body>\r</html>'),
(23, 12, '1', '<code>img</code> element contains both ISMAP and <code>usemap</code> attributes.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r<title>OAC Testfile - Check #12 - Negative</title>\r</head>\r<body>\r<p><img src="image.gif" alt="image map" ismap="ismap" usemap="#map1"/></p>\r</body>\r</html>'),
(24, 12, '0', '<code>img</code> element contains an <code>ismap</code> attribute but no <code>usemap</code> attribute.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r<title>OAC Testfile - Check #12 - Positive</title>\r</head>\r<body>\r<p><img src="image.gif" alt="image map" ismap="ismap" /></p>\r</body>\r</html>'),
(25, 13, '1', '<code>img</code> element has <code>usemap</code> and equivalent text links.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r<title>OAC Testfile - Check #13 - Negative</title>\r</head>\r<body>\r<p><map name="imagemap" id="map1">\r<area shape="poly" coords="185,0,355,0,295,123" href="horses.html" alt="horses"/>\r<area shape="poly" coords="336,202,549,203,549" href="dogs.html" alt="dogs"/>\r<area shape="rect" coords="0,10,172,10" href="birds.html" alt="birds"/>\r</map></p>\r\r<p><img src="navigation.gif" usemap="#imagemap" alt="navigation"/></p>\r\r<p><a href="horses.html">Horses</a> | <a href="dogs.html">Dogs</a> | <a href="birds.html">Birds</a></p>\r</body>\r</html>'),
(26, 13, '0', '<code>img</code> element has <code>usemap</code> but is missing all text links.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r<title>OAC Testfile - Check #13 - Positive</title>\r</head>\r<body>\r<p><map name="imagemap" id="map1">\r<area shape="poly" coords="185,0,355,0,295,123" href="horses.html" alt="horses"/>\r<area shape="poly" coords="336,202,549,203,549" href="dogs.html" alt="dogs"/>\r<area shape="rect" coords="0,10,172,10" href="birds.html" alt="birds"/>\r</map></p>\r\r<p><img src="navigation.gif" usemap="#imagemap" alt="navigation"/></p>\r\r</body>\r</html>'),
(27, 14, '1', 'Image is not referenced within document text by color alone.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r<title>ATRC Testfile - Check #14.2 - Negative</title>\r</head>\r<body>\r<h1>Clayton''s Class</h1>\r\r<p>This is Clayton''s class photo from 2004. Clayton is third from the left wearing a red coat and no boots.</p>\r\r<p><img src="kids.jpg" alt="class photo showing 6 children"/></p>\r\r</body>\r</html>'),
(28, 14, '0', 'Image is referenced by color alone.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r<title>ATRC Testfile - Check #14.1 - Positive</title>\r</head>\r<body>\r<h1>Clayton''s Class</h1>\r\r<p>This is Clayton''s class photo from 2004. Clayton is the one wearing a red coat.</p>\r\r<p><img src="kids.jpg" alt="class photo showing 6 children"/></p>\r\r</body>\r</html>'),
(29, 15, '1', 'Alt text for an image used as a link identifies the destination of the link.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<title>OAC Testfile - Check #15 - Negative</title>\r</head>\r<body>\r<p><a href="routes.html"><img src="topo.gif" alt="Current routes at Boulders Climbing Gym" /></a></p>\r</body>\r</html>'),
(30, 15, '0', 'Alt text for an image used as a link does not identify the destination of the link.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<title>OAC Testfile - Check #15 - Positive</title>\r</head>\r<body>\r<p><a href="routes.html"><img src="topo.gif" alt="large rock with arrow" /></a></p>\r</body>\r</html>'),
(31, 16, '1', 'Image is decorative and Alt text is an empty string ("").', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<title>OAC Testfile - Check #16 - Negative</title>\r</head>\r<body>\r<p>My poem requires a big space<img src="10pttab.gif" alt="" width="5" height="5"/>here.</p>\r</body>\r</html>'),
(32, 16, '0', 'Image is decorative and Alt text is not an empty string ("").', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<title>OAC Testfile - Check #16 - Positive</title>\r</head>\r<body>\r<p>My poem requires a big space<img src="10pttab.gif" alt="big space" width="5" height="5"/>here.</p>\r</body>\r</html>'),
(33, 17, '1', 'No link to sound file.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #17 - Positive</title>\r</head>\r<body>\r<p>\rRead the <a href="carol-text-dogs.txt">text transcript of Carol''s talk about dogs</a>.\r</p>\r</body>\r</html>'),
(34, 17, '0', 'Link to sound file (.wav) but no link to text transcript.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #17 - Positive</title>\r</head>\r<body>\r<p>\rListen to <a href="carol-talking.wav">Carol talking about dogs</a>.\r</p></body>\r</html>'),
(35, 18, '1', '<code>a</code> (anchor) element has target of "_self".', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #18 - Negative</title>\r</head>\r<body>\r<a href="newwindow.html" target="_self">same window</a>\r</body>\r</html>'),
(36, 18, '0', '<code>a</code> (anchor) element has target of "_new".', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #18 - Positive</title>\r</head>\r<body>\r<a href="newwindow.html" target="_new">new window</a>\r</body>\r</html>'),
(37, 19, '1', 'Link text is meaningful when read out of context.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<title>OAC Testfile - Check #19 - Negative</title>\r</head>\r<body>\r<p>We have more information about <a href="dogs.html">dogs</a></p>\r</body>\r</html>'),
(38, 19, '0', 'Link text is not meaningful when read out of context.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<title>OAC Testfile - Check #19 - Positive</title>\r</head>\r<body>\r<p>We have more information <a href="dogs.html">about</a> dogs.</p>\r</body>\r</html>'),
(39, 20, '1', 'No link to multimedia file', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #20 - Negative</title>\r</head>\r<body>\r<p>\r</p></body>\r</html>'),
(40, 20, '0', 'Link to multimedia file (.wav) without a text transcript.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #20 - Positive</title>\r</head>\r<body>\r<p>\rView <a href="movie.wmv">the movie</a>.\r</p></body>\r</html>'),
(41, 21, '1', 'Does not have an <code>applet</code> element.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r<title>ATRC Testfile - Check #21.2 - Negative</title>\r</head>\r<body>\r</body>\r</html>'),
