INSERT INTO `ac_check_examples` (`check_example_id`, `check_id`, `type`, `description`, `content`) VALUES
(102, 51, '0', '<code>title</code> element is empty.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r<title></title>\r</head>\r<body>\r</body>\r</html>'),
(103, 52, '1', '<code>title</code> element has valid length (less than 150 characters).', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #52 - Negative</title>\r</head>\r<body>\r</body>\r</html>'),
(104, 52, '0', '<code>title</code> element is too long (greater than 150 characters).', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>This is a really really long title and maybe it should be shortened. In fact I think it really should be shortened. Yes, let''s all shorted the title so it''s more manageable for everyone.</title>\r</head>\r<body>\r</body>\r</html>'),
(105, 53, '1', '<code>title</code> element does not contain placeholder text.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r<title>OAC Testfile - Check #53 - Negative</title>\r</head>\r<body>\r</body>\r</html>'),
(106, 53, '0', '<code>title</code> element has placehoder text ''title''.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r<title>title</title>\r</head>\r<body>\r</body>\r</html>'),
(107, 54, '1', '<code>title</code> describes the document', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r<title>The History Of Birds</title>\r</head>\r<body>\r<h1>History Of Birds</h1>\r<p>This document contains the history of Birds.\rThe title of the document is appropriate.</p>\r</body>\r</html>'),
(108, 54, '0', '<code>title</code> does not describe the document', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r<title>New Page</title>\r</head>\r<body>\r<h1>History Of Birds</h1>\r<p>This document contains a history of birds.\rThe title of this document does not describe the contents of this document.</p>\r</body>\r</html>'),
(109, 55, '1', 'Does not have an <code>input</code> element.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #55 - Negative</title>\r</head>\r<body>\r</body>\r</html>'),
(110, 55, '0', 'Has <code>input</code> element', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #55 - Positive</title>\r</head>\r<body>\r<form>\r<label for="name">Name:</label> <input type="text" name="name" id="name"></form>\r</body>\r</html>'),
(111, 57, '1', '<code>input</code> has associated label with matching <code>for</code> and <code>id</code>attributes.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r<title>OAC Testfile - Check #57 - Negative</title>\r</head>\r<body>\r<form action="http://somesite.com/prog/adduser" method="post">\r<p>\r<label for="firstname">First name:</label> \r<input type="text" name="firstname" id="firstname" tabindex="1" />\r</p>\r</form>\r</body>\r</html>'),
(112, 57, '0', '<code>input</code> does not have associated label.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r<title>OAC Testfile - Check #57 - Positive</title>\r</head>\r<body>\r<form action="http://somesite.com/prog/adduser" method="post">\r<p>\r<label>First name:</label> \r<input type="text" name="firstname" tabindex="1" />\r</p>\r</form>\r</body>\r</html>'),
(113, 58, '1', '<code>input</code> element, <code>type</code> of "image", has <code>alt</code> attribute.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<title>OAC Testfile - Check #58 - Negative</title>\r</head>\r<body>\r<form action="http://example.com/prog/text-read" method="post">\r<p><input type="image" name="submit" src="finddogs.gif" alt="Find Dogs" /></p>\r</form>\r</body>\r</html>'),
(114, 58, '0', '<code>input</code> element, <code>type</code> of "image", is missing <code>alt</code> attribute.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<title>OAC Testfile - Check #58 - Positive</title>\r</head>\r<body>\r<form action="http://example.com/prog/text-read" method="post">\r<p><input type="image" name="submit" src="finddogs.gif" /></p>\r</form>\r</body>\r</html>'),
(115, 59, '1', '<code>input</code> element, <code>type</code> of "image", has Alt text that identifies the purpose or function of the image.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<title>ATRC Testfile - Check #59 - Negative</title>\r</head>\r<body>\r<form action="http://example.com" method="post">\r<p><input type="image" name="submit" src="rex.jpg" alt="search for cats" /></p>\r</form>\r</body>\r</html>'),
(116, 59, '0', '<code>input</code> element, <code>type</code> of "image", has Alt text that does not identify the purpose or function of the image.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<title>ATRC Testfile - Check #59 - Positive</title>\r</head>\r<body>\r<form action="http://example.com" method="post">\r<p><input type="image" name="submit" src="rex.jpg" alt="A brown and black cat named Rex." /></p>\r</form>\r</body>\r</html>'),
(117, 60, '1', '<code>input</code> element, <code>type</code> of "image", has Alt text less than 100 characters.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<title>OAC Testfile - Check #60 - Negative</title>\r</head>\r<body>\r<form>\r<label for="name">Name</label>: <br/><br/><input type="image" name="name" id="name" src="input.jpg" alt="name">\r</form>\r</body>\r</html>'),
(118, 60, '0', '<code>input</code> element, <code>type</code> of "image", has Alt text greater than 100 characters.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<title>OAC Testfile - Check #60 - Positive</title>\r</head>\r<body>\r<form>\r<label for="name">Name</label>: <br/><br/><input type="image" name="name" id="name" src="name.jpg" alt="This is some very long alt text for the contro''s image. Your alt text should not be this long. Shorten the text to make it more accessible and more pleasant for all.">\r</form>\r</body>\r</html>'),
(119, 61, '1', '<code>input</code> <code>alt</code> attribute is different from the <code>src</code> attribute.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #61 - Negative</title>\r</head>\r<body>\r<form>\r<label for="name">Name</label>: <br/><br/><input type="image" name="name" id="name" src="input.jpg" alt="input name">\r</form>\r</body>\r</html>'),
(120, 61, '0', '<code>input</code> <code>alt</code> attribute is same as the <code>src</code> attribute.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #61 - Positive</title>\r</head>\r<body>\r<form>\r<label for="name">Name</label>: <br/><br/><input type="image" name="name" id="name" src="name.jpg" alt="name.jpg">\r</form>\r</body>\r</html>'),
