(170, 91, '0', '<code>select</code> element does not have associated label.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r<title>ATRC Testfile 91.1 - Positive</title>\r</head>\r<body>\r<form method="post" action="http://www.test.com">\r<p>\r<label>Animal:</label>\r<select name="abcselect" id="animal">\r<option value="1">dog</option>\r<option value="2">cat</option>\r<option value="3">bird</option>\r</select>\r</p>\r</form>\r</body>\r</html>'),
(171, 92, '1', '<code>select</code> element''s <code>onchange</code> attribute does not cause extreme change of context.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r<title>OAC Testfile - Check #92 - Negative</title>\r</head>\r<body>\r\r<form action="http://www.example.com/test" method="post">\r<p>\r<label for="select1">Pick A Number:</label> <select name="abcselect" id="select1" >\r<option value="1">1</option>\r<option value="2">2</option>\r<option value="3">3</option>\r</select>\r<br/><input type="submit" value="select number"/>\r</p>\r</form>\r\r</body>\r</html>'),
(172, 92, '0', '<code>select</code> element''s <code>onchange</code> attribute causes extreme change of context.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r<title>OAC Testfile - Check #92 - Positive</title>\r</head>\r<body>\r\r<form action="http://www.example.com/test" method="post">\r<p>\r<label for="select1">Pick A Number:</label> <select name="abcselect" id="select1" onchange="form.submit();">\r<option value="1">1</option>\r<option value="2">2</option>\r<option value="3">3</option>\r</select>\r</p>\r</form>\r\r</body>\r</html>'),
(173, 94, '1', 'Does not contain a SCRIPT element.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #94 - Negative</title>\r</head>\r<body>\r</body>\r</html>'),
(174, 94, '0', 'Contains a SCRIPT element.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #94 - Positive</title>\r</head>\r<body>\r<script/>\r<noscript>Alternate content for script</noscript>\r</body>\r</html>'),
(175, 95, '1', '<code>textarea</code> element has an associated label using <code>label</code> element.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r<title>ATRC Testfile - Check #95.2 - Positive</title>\r</head>\r<body>\r\r<form action="http://www.test.com/testing" method="post">\r<label for="text1">Comments:</label>\r<textarea name="nametext" id="text1" rows="5" cols="40">\r</form>\r\r</body>\r</html>'),
(176, 95, '0', '<code>textarea</code> element does not have associated label.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r<title>ATRC Testfile - Check #95.1 - Positive</title>\r</head>\r<body>\r\r<form action="http://www.test.com/testing" method="post">\r<label>Comments:</label>\r<textarea name="nametext" id="text1" rows="5" cols="40">\r</form>\r\r</body>\r</html>'),
(177, 96, '1', 'Label is close to <code>textarea</code> element.', '<?xml version="1.0" encoding="UTF-8"?>\n<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\n<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\n<head>\n<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\n<title>Testfile - Check #96.2 - Negative</title>\n</head>\n<body>\n<form action="http://www.example.com" method="post">\n<table>\n<tr><td>first name:</td><td><input type="text" /></td></tr>\n<tr><td>last name:</td><td><input type="text" /></td></tr>\n<tr><td>comment:</td><td align="right"><textarea rows="3" cols="20" ></textarea></td></tr>\n<tr><td colspan="2"><input type="submit" value="submit" /></td></tr>\n</table>\n</form>\n\n</body>\n</html>'),
(178, 96, '0', 'Label is not close to <code>textarea</code> element.', '<?xml version="1.0" encoding="UTF-8"?>\n<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\n<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\n<head>\n<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\n<title>Testfile - Check #96.1 - Positive</title>\n</head>\n<body>\n<form action="http://www.example.com" method="post">\n<table width="100%">\n<tr><td>first name:</td><td align="right"><input type="text" /></td></tr>\n<tr><td>last name:</td><td align="right"><input type="text" /></td></tr>\n<tr><td>comment:</td><td align="right"><textarea rows="3" cols="20" ></textarea></td></tr>\n<tr><td colspan="2"><input type="submit" value="submit" ></td></tr>\n</table>\n</form>\n\n</body>\n</html>'),
(179, 97, '1', '<code>link</code> element does not have <code>rel</code> attribute with value of "stylesheet".', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #97 - Negative</title>\r<link href="docB" rel="foo">\r</head>\r<body>\r</body>\r</html>'),
(180, 97, '0', '<code>link</code> element has <code>rel</code> attribute with value of "stylesheet".', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #97 - Positive</title>\r<link href="docB" rel="stylesheet">\r</head>\r<body>\r</body>\r</html>'),
(181, 98, '1', '<code>body</code> text is less than 10 characters.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #98 - Positive</title>\r</head>\r<body>\r<p>hello</p>\r</body>\r</html>'),
