(201, 109, '1', 'Contains no elements with <code>style</code> attributes.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #109 - Negative</title>\r</head>\r<body>\r\r<p>Hello.</p>\r\r</body>\r</html>'),
(202, 109, '0', 'Contains an element that has a <code>style</code> attribute.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #109 - Positive</title>\r</head>\r<body>\r\r<p style="font-size: 12pt; color: fuchsia">Hello.</p>\r\r<p style="font-size: 12pt; color: fuchsia">Bye.</p>\r\r</body>\r</html>'),
(203, 110, '1', 'Document contains words outside the primary language but they are marked as such.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #110 - Positive</title>\r</head>\r<body>\r<P>And with a certain <SPAN lang="fr">je ne sais quoi</SPAN>, she entered both the room, and his life, forever. </p>\r</body>\r</html>'),
(204, 110, '0', 'Document contains words outside the primary language.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #110 - Positive</title>\r</head>\r<body>\r<P>And with a certain je ne sais quoi, she entered both the room, and his life, forever. </p>\r</body>\r</html>'),
(205, 111, '1', 'Complex data table with a <code>summary</code>.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r<title>ATRC Testfile - Check #111-2 - Negative</title>\r</head>\r<body>\r\r<table border="1" summary="Schedule for Route 7 going downtown. Service begins \rat 4:00 AM and ends at midnight. Intersections are listed in the top row. \rFind the intersection closest to your starting point or destination, then read \rdown that column to find out what time the bus leaves that intersection.">\r<tr>\r<th scope="col">State & First</th>\r<th scope="col">State & Sixth</th>\r<th scope="col">State & Fifteenth</th>\r<th scope="col">Fifteenth & Morrison</th>\r</tr>\r<td>4:00</td>\r<td>4:05</td>\r<td>4:11</td>\r<td>4:19</td>\r</tr>\r</tr>\r<td>5:00</td>\r<td>5:05</td>\r<td>5:11</td>\r<td>5:19</td>\r</tr>\r</tr>\r<td>6:00</td>\r<td>6:05</td>\r<td>6:11</td>\r<td>6:19</td>\r</tr>\r</table>\r\r</body>\r</html>'),
(206, 111, '0', 'Complex data table without a <code>summary</code>.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r<title>ATRC Testfile - Check #111.1 - Positive</title>\r</head>\r<body>\r\r<table border="1">\r<tr>\r<th scope="col">State & First</th>\r<th scope="col">State & Sixth</th>\r<th scope="col">State & Fifteenth</th>\r<th scope="col">Fifteenth & Morrison</th>\r</tr>\r<td>4:00</td>\r<td>4:05</td>\r<td>4:11</td>\r<td>4:19</td>\r</tr>\r</tr>\r<td>5:00</td>\r<td>5:05</td>\r<td>5:11</td>\r<td>5:19</td>\r</tr>\r</tr>\r<td>6:00</td>\r<td>6:05</td>\r<td>6:11</td>\r<td>6:19</td>\r</tr>\r</table>\r\r</body>\r</html>'),
(207, 112, '1', 'Data <code>table</code> with a valid <code>summary</code>.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r<title>ATRC Testfile - Check #112-2 - Negative</title>\r</head>\r<body>\r\r<table border="1" summary="This table shows the number of cups of coffee consumed by each senator, the type of coffee (decaf or regular), and whether taken with sugar.">\r\r<tr><th>name</th><th>number of cups</th><th>type</th><th>with sugar</th></tr>\r<tr><td>Adams, Willie</td><td>2</td><td>regular</td><td>sugar</td></tr>\r<tr><td>Bacon, Lise</td><td>4</td><td>regular</td><td>no sugar</td></tr>\r<tr><td>Chaput, Maria</td><td>1</td><td>decaf</td><td>sugar</td></tr>\r<tr><td>Di Nino, Consiglio</td><td>0</td><td>not applicable</td><td>not applicable</td></tr>\r<tr><td>Eggleton, Art</td><td>6</td><td>regular</td><td>no sugar</td></tr>\r</table>\r\r</body>\r</html>');
