(262, 140, '0', 'Password <code>input</code> element does not have <code>tabindex</code> attribute.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r<title>ATRC Testfile - Check #140.1 - Positive</title>\r</head>\r<body>\r<form action="http://www.example.com" method="post">\r<p>\r<label for="name">Name</label>: <input type="password" name="name" id="name" value="your name here" />\r</p>\r</form>\r</body>\r</html>'),
(263, 141, '1', 'Checkbox <code>input</code> element has valid <code>tabindex</code> attribute.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r<title>ATRC Testfile - Check #141.2 - Positive</title>\r</head>\r<body>\r<form action="http://www.example.com" method="post">\r<p>\r<label for="name">Name</label>: <input type="checkbox" name="name" id="name" tabindex="" />\r</p>\r</form>\r</body>\r</html>'),
(264, 141, '0', 'Checkbox <code>input</code> element does not have <code>tabindex</code> attribute.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r<title>ATRC Testfile - Check #141.1 - Positive</title>\r</head>\r<body>\r<form action="http://www.example.com" method="post">\r<p>\r<label for="name">Name</label>: <input type="checkbox" name="name" id="name"  />\r</p>\r</form>\r</body>\r</html>'),
(265, 142, '1', 'File <code>input</code> element has valid <code>tabindex</code> attribute.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r<title>ATRC Testfile - Check #142.2 - Positive</title>\r</head>\r<body>\r<form action="http://www.example.com" method="post">\r<p>\r<label for="name">Name</label>: <input type="file" name="name" id="name" tabindex="" />\r</p>\r</form>\r</body>\r</html>'),
(266, 142, '0', 'File <code>input</code> element does not have <code>tabindex</code> attribute.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r<title>ATRC Testfile - Check #142.1 - Positive</title>\r</head>\r<body>\r<form action="http://www.example.com" method="post">\r<p>\r<label for="name">Name</label>: <input type="file" name="name" id="name"  />\r</p>\r</form>\r</body>\r</html>'),
(267, 143, '1', 'Content contains <code>address</code> element.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #143 - Negative</title>\r</head>\r<body>\r<address><a href="mailto:name@company.com">joe smith</a></address>\r</body>\r</html>'),
(268, 143, '0', 'Content does not have <code>address</code> element.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #143 - Positive</title>\r</head>\r<body>\r</body>\r</html>'),
(269, 145, '1', 'Link to multimedia file also has link to text alternative.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r<title>ATRC Testfile - Check #145.2 - Negative</title>\r</head>\r<body>\r<p>View <a href="movie.wav">the movie</a> <a href="alternative.html">(text alternative)</a>.</p>\r</body>\r</html>'),
(270, 145, '0', 'Link to multimedia file (.wmv) without a text alternative.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r<title>ATRC Testfile - Check #145.1 - Positive</title>\r</head>\r<body>\r<p>View <a href="movie.wmv">the movie</a>.</p>\r</body>\r</html>'),
(271, 146, '1', 'Object does not have <code>type</code> of "video".', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #146 - Negative</title>\r</head>\r<body>\r<object/>\r</body>\r</html>'),
(272, 146, '0', 'Object with <code>type</code> of "video".', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #146 - Positive</title>\r</head>\r<body>\r<object type="video"/>\r</body>\r</html>'),
(273, 147, '1', 'Has a <code>link</code> element with a <code>rel</code> attribute value of "index".', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r<title>ATRC Testfile - Check #147.2 - Negative</title>\r<link rel="Index" href="../index.html" />\r</head>\r<body>\r</body>\r</html>'),
(274, 147, '0', 'Does not have a <code>link</code> element.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r<title>ATRC Testfile - Check #147.1 - Positive</title>\r</head>\r<body>\r</body>\r</html>');
INSERT INTO `ac_check_examples` (`check_example_id`, `check_id`, `type`, `description`, `content`) VALUES
(275, 148, '0', 'Does not have a <code>link</code> element.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r\n<html lang="en">\r\n	<head>\r\n		<title>OAC Testfile - Check #148 - Positive</title>\r\n		<link rel="stylesheet" href="stylesheet.xsl">\r\n	</head>\r\n	<body>\r\n	</body>\r\n</html>'),
(276, 151, '1', 'Data <code>table</code> with a <code>caption</code> that describes the nature of the table.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r<title>ATRC Testfile - Check #151.2 - Negative</title>\r</head>\r<body>\r\r<table border="1"><caption>Coffee Consumed By Senators</caption>\r<tr><th>name</th><th>number of cups</th><th>type</th><th>with sugar</th></tr>\r<tr><td>Adams, Willie</td><td>2</td><td>regular</td><td>sugar</td></tr>\r<tr><td>Bacon, Lise</td><td>4</td><td>regular</td><td>no sugar</td></tr>\r<tr><td>Chaput, Maria</td><td>1</td><td>decaf</td><td>sugar</td></tr>\r<tr><td>Di Nino, Consiglio</td><td>0</td><td>not applicable</td><td>not applicable</td></tr>\r<tr><td>Eggleton, Art</td><td>6</td><td>regular</td><td>no sugar</td></tr>\r</table>\r\r</body>\r</html>'),
(277, 151, '0', 'Data <code>table</code> without a <code>caption</code> is not identified within the document.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r<title>ATRC Testfile - Check #151.1 - Positive</title>\r</head>\r<body>\r\r<table border="1">\r<tr><th>name</th><th>number of cups</th><th>type</th><th>with sugar</th></tr>\r<tr><td>Adams, Willie</td><td>2</td><td>regular</td><td>sugar</td></tr>\r<tr><td>Bacon, Lise</td><td>4</td><td>regular</td><td>no sugar</td></tr>\r<tr><td>Chaput, Maria</td><td>1</td><td>decaf</td><td>sugar</td></tr>\r<tr><td>Di Nino, Consiglio</td><td>0</td><td>not applicable</td><td>not applicable</td></tr>\r<tr><td>Eggleton, Art</td><td>6</td><td>regular</td><td>no sugar</td></tr>\r</table>\r\r</body>\r</html>'),
(278, 152, '1', '<code>table</code> headers are short.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #152 - Positive</title>\r</head>\r<body>\r\r<TABLE border="1" summary="This simple data table demonstrates the use of summary">\r<TR>\r<TD></TD>\r<TH>Col. 1 header</TH>\r<TH>Col. 2 header</TH>\r</TR>\r<TR>\r<TH>Row 1 header</TH>\r<TD>C1R1</TD>\r<TD>C1R2</TD>\r</TR>\r<TR>\r<TH>Row 2 header</TH>\r<TD>C2R1</TD>\r<TD>C2R2</TD>\r</TR>\r</TABLE>\r\r</body>\r</html>'),
(279, 152, '0', '<code>table</code> headers are long.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #152 - Positive</title>\r</head>\r<body>\r\r<TABLE border="1" summary="This simple data table demonstrates the use of summary">\r<caption>A Test Table</caption>\r<TR>\r<TD></TD>\r<TH>Col. 1 header really long text</TH>\r<TH>Col. 2 header really long text</TH>\r</TR>\r<TR>\r<TH>Row 1 header</TH>\r<TD>C1R1</TD>\r<TD>C1R2</TD>\r</TR>\r<TR>\r<TH>Row 2 header</TH>\r<TD>C2R1</TD>\r<TD>C2R2</TD>\r</TR>\r</TABLE>\r\r\r</body>\r</html>'),
(280, 153, '1', 'Header abbreviations are short.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #153 - Positive</title>\r</head>\r<body>\r\r<TABLE border="1" summary="This simple data table demonstrates the use of summary">\r<caption>A Test Table</caption>\r<TR>\r<TD></TD>\r<TH abbr="short abbrev">Col. 1 header really long text</TH>\r<TH abbr="short abbrev 2">Col. 2 header really long text</TH>\r</TR>\r<TR>\r<TH>Row 1 header</TH>\r<TD>C1R1</TD>\r<TD>C1R2</TD>\r</TR>\r<TR>\r<TH>Row 2 header</TH>\r<TD>C2R1</TD>\r<TD>C2R2</TD>\r</TR>\r</TABLE>\r\r\r</body>\r</html>'),
(281, 153, '0', 'Header abbreviations are long.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #153 - Positive</title>\r</head>\r<body>\r\r<TABLE border="1" summary="This simple data table demonstrates the use of summary">\r<caption>A Test Table</caption>\r<TR>\r<TD></TD>\r<TH abbr="This abbreviation is much too long.">Col. 1 header really long text</TH>\r<TH abbr="abbrev OK">Col. 2 header really long text</TH>\r</TR>\r<TR>\r<TH>Row 1 header</TH>\r<TD>C1R1</TD>\r<TD>C1R2</TD>\r</TR>\r<TR>\r<TH>Row 2 header</TH>\r<TD>C2R1</TD>\r<TD>C2R2</TD>\r</TR>\r</TABLE>\r\r\r</body>\r</html>'),
(282, 154, '1', '<code>pre</code> not used.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #154 - Positive</title>\r</head>\r<body>\r</body>\r</html>'),
(283, 154, '0', '<code>pre</code> used.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #154 - Positive</title>\r</head>\r<body>\r\r<pre>\r     dogs  cats\rbig	  2     4\rsmall 5     7\r</pre>\r\r</body>\r</html>'),
(284, 159, '1', 'IMG does not have a <code>title</code>.', '<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/REC-html40/strict.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #159 - Negative</title>\r</head>\r<body>\r<img src="rex.jpg" alt="A brown and black cat named Rex."/>\r</body>\r</html>'),
(285, 159, '0', 'IMG has a <code>title</code>.', '<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/REC-html40/strict.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #159 - Positive</title>\r</head>\r<body>\r<img src="rex.jpg" alt="A brown and black cat named Rex." title="Rex the bad cat"/>\r</body>\r</html>'),
(286, 160, '1', 'Document does not contain an <code>object</code> element.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #160 - Negative</title>\r</head>\r<body>\r</body>\r</html>'),
(287, 160, '0', 'Document contains an <code>object</code> element.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #160 - Positive</title>\r</head>\r<body>\r<object/>\r</body>\r</html>'),
(288, 163, '1', '<code>embed</code> contains a <code>noembed</code> element.', '<html lang="en">\r<head>\r<title>ATRC Testfile - Check #163.2 - Negative</title>\r</head>\r<body>\r<embed src="../movies/history_of_rome.mov" height="60" width="144" autostart="false">\r	<noembed>\r		<a href="../transcripts/transcript_history_rome.htm">Transcript of "The history of Rome"</a>\r	</noembed>\r</embed>\r</body>\r</html>'),
(289, 163, '0', '<code>embed</code> missing <code>noembed</code>.', '<html lang="en">\r<head>\r<title>ATRC Testfile - Check #163.1 - Positive</title>\r</head>\r<body>\r<embed src="../movies/history_of_rome.mov" height="60" width="144" autostart="false">\r</embed>\r</body>\r</html>'),
(290, 164, '1', '<code>noembed</code> element not present.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #164 - Negative</title>\r</head>\r<body>\r<embed src="demo.mov">\r</embed>\r</body>\r</html>'),
(291, 164, '0', '<code>noembed</code> element present.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #164 - Positive</title>\r</head>\r<body>\r<embed src="demo.mov">\r<noembed>Alternate content for the embed</noembed>\r</embed>\r</body>\r</html>'),
(292, 165, '1', '<code>embed</code> with <code>alt</code> attribute.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #165 - Negative</title>\r</head>\r<body>\r<embed alt="description of the embed" src="demo.mov">\r<noembed>Alternate content for the embed</noembed>\r</embed>\r</body>\r</html>'),
(293, 165, '0', '<code>embed</code> missing <code>alt</code> attribute.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #165 - Positive</title>\r</head>\r<body>\r<embed src="demo.mov">\r<noembed>Alternate content for the embed</noembed>\r</embed>\r</body>\r</html>'),
(294, 166, '1', '<code>embed</code> with valid <code>alt</code> attribute.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #166 - Negative</title>\r</head>\r<body>\r<embed alt="description of the embed" src="demo.mov">\r<noembed>Alternate content for the embed</noembed>\r</embed>\r</body>\r</html>'),
(295, 166, '0', '<code>embed</code> with empty <code>alt</code> attribute.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #166 - Positive</title>\r</head>\r<body>\r<embed alt=""  src="demo.mov">\r<noembed>Alternate content for the embed</noembed>\r</embed>\r</body>\r</html>'),
(296, 167, '1', '<code>iframe</code> without a <code>longdesc</code> attribute.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #167 - Negative</title>\r</head>\r<body>\r<iframe/>\r</body>\r</html>'),
(297, 167, '0', '<code>iframe</code> with a <code>longdesc</code> attribute.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #167 - Positive</title>\r</head>\r<body>\r<iframe longdesc="file.html"/>\r</body>\r</html>'),
(298, 168, '1', 'radio button group contains both <code>fieldset</code> and <code>legend</code> elements.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r<title>OAC Testfile - Check #168 - Negative</title>\r</head>\r<body>\r\r<form action="http://example.com/donut" method="post">\r<fieldset>\r<legend>Donut Type</legend>\r<p>\r<input type="radio" name="flavour" id="choc" value="chocolate" checked="checked" />\r<label for="choc">Chocolate</label><br/>\r<input type="radio" name="flavour" id="cream" value="cream"/>\r<label for="cream">Cream Filled</label><br/>\r<input type="radio" name="flavour" id="honey" value="honey"/>\r<label for="honey">Honey Glazed</label>\r</p>\r</fieldset>\r<p><input type="submit" value="Purchase Donut"/></p>\r</form>\r\r</body>\r</html>'),
(299, 168, '0', 'radio button group contains no <code>fieldset</code> or <code>legend</code> elements.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r<title>OAC Testfile - Check #168 - Positive</title>\r</head>\r<body>\r\r<form action="http://example.com/donut" method="post">\r<p>\r<input type="radio" name="flavour" id="choc" value="chocolate" checked="checked" />\r<label for="choc">Chocolate</label><br/>\r<input type="radio" name="flavour" id="cream" value="cream"/>\r<label for="cream">Cream Filled</label><br/>\r<input type="radio" name="flavour" id="honey" value="honey"/>\r<label for="honey">Honey Glazed</label>\r<br/><input type="submit" value="Purchase Donut"/>\r</p>\r</form>\r\r</body>\r</html>'),
