(430, 240, '1', 'Text alternative file tells the same story and presents the same information as the multimedia file.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r<title>ATRC Testfile - Check #240.2 - Negative</title>\r</head>\r<body>\r<p>View <a href="movie.wav">the movie</a> <a href="alternative2.html">(text alternative)</a>.</p>\r\r<p>Shown below is the content of the text alternative file.</p>\r\r<p>Harmonica sounds play softly in the background. The setting is a small dusty town in the wild\rwest days. The opening shot is the main street of the town under the bright noon sun. The harmonica sounds stop and the sounds of the wind can be heard softly. A tall man dressed all in black wearing\ra black hat stands at the far end of the street. The shot changes to a closeup of the man''s emotionless face. He spits tobacco juice on the ground but leaves some brown liquid dripping down his chin. He slowly speaks the words "It''s about time now sherrif".</p>\r\r</body>\r</html>'),
(431, 240, '0', 'Text alternative file does not tell the same story and present the same information as the multimedia file.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r<title>ATRC Testfile - Check #240.1 - Negative</title>\r</head>\r<body>\r<p>View <a href="movie.wmv">the movie</a> <a href="alternative1.html">(text alternative)</a>.</p>\r\r<p>Shown below is the content of the text alternative file.</p>\r\r<p>This movie shows a gunfight.</p>\r\r</body>\r</html>'),
(432, 241, '1', 'Table markup is used for tabular information.', '<?xml version="1.0" encoding="UTF-8"?>\n<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\n<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\n<head>\n<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\n<title>ATRC Testfile - Check #241.2 - Negative</title>\n</head>\n<body>\n<table border="1" summary="This table shows the number of cups of coffee consumed by each senator, the type of coffee (decaf or regular), and whether taken with sugar.">\n\n<tr><th>name</th><th>number of cups</th><th>type</th><th>with sugar</th></tr>\n<tr><td>Adams, Willie</td><td>2</td><td>regular</td><td>sugar</td></tr>\n<tr><td>Bacon, Lise</td><td>4</td><td>regular</td><td>no sugar</td></tr>\n<tr><td>Chaput, Maria</td><td>1</td><td>decaf</td><td>sugar</td></tr>\n<tr><td>Di Nino, Consiglio</td><td>0</td><td>not applicable</td><td>not applicable</td></tr>\n<tr><td>Eggleton, Art</td><td>6</td><td>regular</td><td>no sugar</td></tr>\n</table>\n\n</body>\n</html>'),
(433, 241, '0', 'Table markup is not used for tabular information.', '<?xml version="1.0" encoding="UTF-8"?>\n<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\n<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\n<head>\n<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\n<title>ATRC Testfile - Check #241.1 - Positive</title>\n</head>\n<body>\n\n<p>\n<pre>\nname           number of cups   type   with sugar\nAdams, Willie      2          regular     sugar\nBacon, Lise        4          regular     no sugar\nChaput, Maria      1          decaf       sugar\nDi Nino, Consiglio 0          n/a         n/a\nEggleton, Art      6          regular     no sugar \n</pre>\n</p>\n\n</body>\n</html>'),
(434, 242, '1', '<code>caption</code> identifies the <code>table</code>.', '<?xml version="1.0" encoding="UTF-8"?>\n<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\n<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\n<head>\n<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\n<title>ATRC Testfile - Check #242.2 - Negative</title>\n</head>\n<body>\n<table border="1"><caption>Cups of coffee consumed by each senator</caption>\n\n<tr><th>name</th><th>number of cups</th><th>type</th><th>with sugar</th></tr>\n<tr><td>Adams, Willie</td><td>2</td><td>regular</td><td>sugar</td></tr>\n<tr><td>Bacon, Lise</td><td>4</td><td>regular</td><td>no sugar</td></tr>\n<tr><td>Chaput, Maria</td><td>1</td><td>decaf</td><td>sugar</td></tr>\n<tr><td>Di Nino, Consiglio</td><td>0</td><td>not applicable</td><td>not applicable</td></tr>\n<tr><td>Eggleton, Art</td><td>6</td><td>regular</td><td>no sugar</td></tr>\n</table>\n\n</body>\n</html>'),
(435, 242, '0', '<code>caption</code> does not identify the <code>table</code>.', '<?xml version="1.0" encoding="UTF-8"?>\n<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\n<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\n<head>\n<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\n<title>ATRC Testfile - Check #242.2 - Positive</title>\n</head>\n<body>\n<table border="1"><caption>Caption Goes Here</caption>\n\n<tr><th>name</th><th>number of cups</th><th>type</th><th>with sugar</th></tr>\n<tr><td>Adams, Willie</td><td>2</td><td>regular</td><td>sugar</td></tr>\n<tr><td>Bacon, Lise</td><td>4</td><td>regular</td><td>no sugar</td></tr>\n<tr><td>Chaput, Maria</td><td>1</td><td>decaf</td><td>sugar</td></tr>\n<tr><td>Di Nino, Consiglio</td><td>0</td><td>not applicable</td><td>not applicable</td></tr>\n<tr><td>Eggleton, Art</td><td>6</td><td>regular</td><td>no sugar</td></tr>\n</table>\n\n</body>\n</html>'),
(436, 243, '1', 'The table summary and caption are different.', '<?xml version="1.0" encoding="UTF-8"?>\n<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\n<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\n<head>\n<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\n<title>ATRC Testfile - Check #243.2 - Negative</title>\n</head>\n<body>\n<table border="1" summary="This table shows the number of cups of coffee consumed by each senator, the type of coffee (decaf or regular), and whether taken with sugar."><caption>Cups of coffee consumed by each senator</caption>\n\n<tr><th>name</th><th>number of cups</th><th>type</th><th>with sugar</th></tr>\n<tr><td>Adams, Willie</td><td>2</td><td>regular</td><td>sugar</td></tr>\n<tr><td>Bacon, Lise</td><td>4</td><td>regular</td><td>no sugar</td></tr>\n<tr><td>Chaput, Maria</td><td>1</td><td>decaf</td><td>sugar</td></tr>\n<tr><td>Di Nino, Consiglio</td><td>0</td><td>not applicable</td><td>not applicable</td></tr>\n<tr><td>Eggleton, Art</td><td>6</td><td>regular</td><td>no sugar</td></tr>\n</table>\n\n</body>\n</html>'),
(437, 243, '0', 'The table summary is the same as the table caption.', '<?xml version="1.0" encoding="UTF-8"?>\n<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\n<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\n<head>\n<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\n<title>ATRC Testfile - Check #243.2 - Positive</title>\n</head>\n<body>\n<table border="1" summary="cups of coffee consumed by each senator"><caption>Cups of coffee consumed by each senator</caption>\n\n<tr><th>name</th><th>number of cups</th><th>type</th><th>with sugar</th></tr>\n<tr><td>Adams, Willie</td><td>2</td><td>regular</td><td>sugar</td></tr>\n<tr><td>Bacon, Lise</td><td>4</td><td>regular</td><td>no sugar</td></tr>\n<tr><td>Chaput, Maria</td><td>1</td><td>decaf</td><td>sugar</td></tr>\n<tr><td>Di Nino, Consiglio</td><td>0</td><td>not applicable</td><td>not applicable</td></tr>\n<tr><td>Eggleton, Art</td><td>6</td><td>regular</td><td>no sugar</td></tr>\n</table>\n\n</body>\n</html>');
INSERT INTO `ac_check_examples` (`check_example_id`, `check_id`, `type`, `description`, `content`) VALUES
(438, 244, '1', 'Data table with both row and column headers contains <code>scope</code> attributes.', '<?xml version="1.0" encoding="UTF-8"?>\n<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\n<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\n<head>\n<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\n<title>ATRC Testfile - Check #244.2 - Negative</title>\n</head>\n<body>\n\n<table border="1">\n<tr><th scope="col">Name</th><th scope="col">Birth</th><th scope="col">Gender</th></tr>\n<tr><th scope="row">Clayton</th><td>2005-10-10</td><td>male</td></tr>\n<tr><th scope="row">Carol</th><td>2005-10-11</td><td>female</td></tr>\n<tr><th scope="row">Susan</th><td>2005-10-12</td><td>female</td></tr>\n<tr><th scope="row">Oleg</th><td>2005-10-13</td><td>male</td></tr>\n<tr><th scope="row">Belnar</th><td>2005-10-14</td><td>male</td></tr>\n</table>\n\n</body>\n</html>'),
(439, 244, '0', 'Data table with both row and column headers does not contain <code>scope</code> attributes.', '<?xml version="1.0" encoding="UTF-8"?>\n<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\n<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\n<head>\n<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\n<title>ATRC Testfile - Check #244.1 - Positive</title>\n</head>\n<body>\n\n<table border="1">\n<tr><th>Name</th><th>Birth</th><th>Gender</th></tr>\n<tr><th>Clayton</th><td>2005-10-10</td><td>male</td></tr>\n<tr><th>Carol</th><td>2005-10-11</td><td>female</td></tr>\n<tr><th>Susan</th><td>2005-10-12</td><td>female</td></tr>\n<tr><th>Oleg</th><td>2005-10-13</td><td>male</td></tr>\n<tr><th>Belnar</th><td>2005-10-14</td><td>male</td></tr>\n<tr></tr>\n</table>\n\n</body>\n</html>'),
(440, 245, '1', 'Data table with multiple rows of column headers contains <code>id</code> and <code>headers</code> attributes.', '<?xml version="1.0" encoding="UTF-8"?>\n<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\n<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\n<head>\n<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\n<title>ATRC Testfile - Check #245.2 - Negative</title>\n</head>\n<body>\n\n<table border="1" >\n<tr>\n	<th id="class">Class</th>\n	<th id="teacher">Teacher</th>\n	<th id="males">Males</th>\n	<th id="females">Females</th>\n</tr>\n<tr>\n	<th id="firstyear" rowspan="2">First Year</th>\n	<th id="Bolter" headers="firstyear teacher">D. Bolter</th>\n	<td headers="firstyear Bolter males">5</td>\n	<td headers="firstyear Bolter females">4</td>\n</tr>\n<tr>\n	<th id="Cheetham" headers="firstyear teacher">A. Cheetham</th>\n	<td headers="firstyear Cheetham males">7</td>\n	<td headers="firstyear Cheetham females">9</td>\n</tr>\n<tr>\n	<th id="secondyear" rowspan="3">Second Year</th>\n	<th id="Lam" headers="secondyear teacher">M. Lam</th>\n	<td headers="secondyear Lam males">3</td>\n	<td headers="secondyear Lam females">9</td>\n</tr>\n<tr>\n	<th id="Crossy" headers="secondyear teacher">S. Crossy</th>\n	<td headers="secondyear Crossy males">4</td>\n	<td headers="secondyear Crossy females">3</td>\n</tr>\n<tr>\n	<th id="Forsyth" headers="secondyear teacher">A. Forsyth</th>\n	<td headers="secondyear Forsyth males">6</td>\n	<td headers="secondyear Forsyth females">9</td>\n</tr>\n</table>\n\n</body>\n</html>'),
(441, 245, '0', 'Data table with multiple rows of column headers does not contain <code>id</code> or <code>headers</code> attributes.', '<?xml version="1.0" encoding="UTF-8"?>\n<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\n<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\n<head>\n<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\n<title>ATRC Testfile - Check #245.1 - Positive</title>\n</head>\n<body>\n\n<table border="1" >\n<tr>\n	<th>Class</th>\n	<th>Teacher</th>\n	<th>Males</th>\n	<th>Females</th>\n</tr>\n<tr>\n	<th rowspan="2">First Year</th>\n	<th>D. Bolter</th>\n	<td>5</td>\n	<td>4</td>\n</tr>\n<tr>\n	<th>A. Cheetham</th>\n	<td>7</td>\n	<td>9</td>\n</tr>\n<tr>\n	<th rowspan="3">Second Year</th>\n	<th>M. Lam</th>\n	<td>3</td>\n	<td>9</td>\n</tr>\n<tr>\n	<th>S. Crossy</th>\n	<td>4</td>\n	<td>3</td>\n</tr>\n<tr>\n	<th>A. Forsyth</th>\n	<td>6</td>\n	<td>9</td>\n</tr>\n</table>\n\n</body>\n</html>'),
(442, 246, '1', 'Required fields (first name and last name) are marked as "required".', '<?xml version="1.0" encoding="UTF-8"?>\n<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\n<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\n<head>\n<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\n<title>ATRC Testfile - Check #246.2 - Negative</title>\n</head>\n<body>\n\n<form action="http://www.test.com">\n\n<p>\n<label for="firstname">First Name (required):</label>\n<input type="text" id="firstname" /><br/>\n<label for="lastname">Last Name (required):</label>\n<input type="text" id="lastname" /><br/>\n<label for="colour">Favourite Colour:</label>\n<input type="text" id="colour" /><br/>\n<input type="submit" value="submit"/>\n</p>\n\n</form>\n\n</body>\n</html>'),
(443, 246, '0', 'Required fields (first name and last name) are not marked as "required".', '<?xml version="1.0" encoding="UTF-8"?>\n<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\n<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\n<head>\n<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\n<title>ATRC Testfile - Check #246.1 - Positive</title>\n</head>\n<body>\n\n<form action="http://www.test.com">\n\n<p>\n<label for="firstname">First Name:</label>\n<input type="text" id="firstname" /><br/>\n<label for="lastname">Last Name:</label>\n<input type="text" id="lastname" /><br/>\n<label for="colour">Favourite Colour:</label>\n<input type="text" id="colour" /><br/>\n<input type="submit" value="submit"/>\n</p>\n\n</form>\n\n</body>\n</html>'),
(444, 247, '1', 'Checkbox group contains both <code>fieldset</code> and <code>legend</code> elements.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r\r\r<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r<META content="text/xhtml; charset=UTF-8" http-equiv="Content-Type">\r\r<title>ATRC Testfile - Check #247.2 - Negative</title>\r</head>\r<body>\r\r<form action="http://example.com/donut" method="post">\r<fieldset>\r<legend>Donuts Requested (check all that apply)</legend>\r<p>\r<input type="checkbox" name="flavour" id="choc" value="chocolate" />\r<label for="choc">Chocolate</label><br/>\r<input type="checkbox" name="flavour" id="cream" value="cream" />\r<label for="cream">Cream Filled</label><br/>\r<input type="checkbox" name="flavour" id="honey" value="honey" />\r<label for="honey">Honey Glazed</label>\r</p>\r</fieldset>\r<p><input type="submit" value="Purchase Donuts"/></p>\r</form>\r\r</body>\r</html>'),
(445, 247, '0', 'Checkbox group contains no <code>fieldset</code> or <code>legend</code> elements.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r<title>ATRC Testfile - Check #247.1 - Positive</title>\r</head>\r<body>\r\r<form action="http://example.com/donut" method="post">\r<p>\r<input type="checkbox" name="flavour" id="choc" value="chocolate" />\r<label for="choc">Chocolate</label><br/>\r<input type="checkbox" name="flavour" id="cream" value="cream"/>\r<label for="cream">Cream Filled</label><br/>\r<input type="checkbox" name="flavour" id="honey" value="honey"/>\r<label for="honey">Honey Glazed</label>\r<br/><input type="submit" value="Purchase Donuts"/>\r</p>\r</form>\r\r</body>\r</html>'),
(446, 248, '1', 'Visual list contains proper markup.', '<?xml version="1.0" encoding="UTF-8"?>\n<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\n<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\n<head>\n<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\n<title>ATRC Testfile - Check #248.2 - Negative</title>\n</head>\n<body>\n\n<ul>\n<li>chocolate</li>\n<li>vanilla</li>\n<li>cherry</li>\n<li>bananna</li>\n</ul>\n\n</body>\n</html>'),
(447, 248, '0', 'Visual list does not contain proper markup.', '<?xml version="1.0" encoding="UTF-8"?>\n<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\n<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\n<head>\n<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\n<title>ATRC Testfile - Check #248.1 - Positive</title>\n</head>\n<body>\n\n<p>\n* chocolate<br/>\n* vanilla<br/>\n* cherry<br/>\n* bananna<br/>\n</p>\n\n</body>\n</html>'),
(448, 249, '1', 'Semantic markup is used for emphasized and special text.', '<?xml version="1.0" encoding="UTF-8"?>\n<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\n<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\n<head>\n<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\n<title>ATRC Testfile - Check #249.2 - Negative</title>\n</head>\n<body>\n\n<p>The following is an excerpt from the <cite>The Story of my Life</cite> by Helen Keller</p>\n <blockquote>\n <p>Even in the days before my teacher came, I used to feel along the square stiff boxwood\n hedges, and, guided by the sense of smell, would find the first violets and lilies.  \n There, too, after a fit of temper, I went to find comfort and to hide my hot face \n in the cool leaves and grass.</p>\n </blockquote>\n\n<p>Helen Keller said, <q>Self-pity is our worst enemy and if we yield to it, \nwe can never do anything good in the world.</q></p>\n\n<p>Beth received 1<sup>st</sup> place in the 9<sup>th</sup> grade science competition.</p>\n<p>The chemical notation for water is H<sub>2</sub>O.</p>\n\n</body>\n</html>'),
(449, 249, '0', 'Semantic markup not used for emphasized and special text.', '<?xml version="1.0" encoding="UTF-8"?>\n<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\n<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\n<head>\n<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\n<title>ATRC Testfile - Check #249.1 - Positive</title>\n</head>\n<body>\n\n<p>The following is an excerpt from the The Story of my Life by Helen Keller</p>\n\n <p>Even in the days before my teacher came, I used to feel along the square stiff boxwood\n hedges, and, guided by the sense of smell, would find the first violets and lilies.  \n There, too, after a fit of temper, I went to find comfort and to hide my hot face \n in the cool leaves and grass.</p>\n\n\n<p>Helen Keller said, Self-pity is our worst enemy and if we yield to it, \nwe can never do anything good in the world.</p>\n\n<p>Beth received 1st place in the 9th grade science competition.</p>\n<p>The chemical notation for water is H2O.</p>\n\n</body>\n</html>'),
(450, 250, '1', 'Submit button is referenced by both shape and text.', '<?xml version="1.0" encoding="UTF-8"?>\n<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\n<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\n<head>\n<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\n<title>ATRC Testfile - Check #250.2 - Negative</title>\n</head>\n<body>\n\n<p>To submit the form, press the round button labeled GO</p>\n\n<form action="http://example.com" method="post">\n<p>\n<input type="image" name="submit" src="go.gif" alt="go"/>\n</p>\n</form>\n\n</body>\n</html>'),
